                    <p>* Ürünün faturası,</p>
                    <p>*  Satın alım tarihinden itibaren 15 gün geçmemiş olması,</p>
                    <p>* Ürünün hiçbir şekilde kullanılmamış, dış ortamda denenmemiş olmaması,</p>
